import React from "react";
import { Container , Grid} from "@material-ui/core";

const Survey = ()=>{
    return(
        <Container fullwidth style={{marginTop:50}}>
            <Grid container spacing={2}>
            <Grid item  md={3} xs={12} ></Grid>
            </Grid>

        </Container>
    );
}

export default Survey;
